The sun is pure energy; just as it fuels our food to grow, our food fuels us with energy from the sun.  Fruit is ideal for breakfast allowing the body to ease into the day with wholesome nourishment. Today my morning smoothie was a medley of goodness containing frozen bananas, raspberries, green grapes, passion fruit, pineapple, baby spinach, a wedge of lemon and purified water.¬† Umm ummm.¬†¬† My morning smoothies are so loaded with calories and good nutrition that they carry me through the better part of the day.¬† To top it off, I enjoyed a bowl of home grown papaya, a special treat too good to be lost in a blender.
If you don't live in a tropical climate, experiment with fruits that grow in your region and create a smoothie to suit your own taste.  Adding citrus is a great secret to creating a taste sensation coupled with the goodness of greens, even if you start with a pinch.¬† The vital minerals and fiber from the greens helps to balance the sweetness and regulate sugar absorption.  If you live somewhere barren, frozen fruits and greens are the next best thing.¬† In this instance, you might consider adding a SuperGreens powder or greens juice to the mix.¬† I have found an incredibly nourishing and pleasant tasting one made of 100% organic ingredients, flash frozen at harvest and ready to go from farm to bottle.¬† Check it out:¬†¬†https://loving.thegoodinside.com/shop/product/super-green-juice/¬† If you want to give it a try, please email me at¬†halaihealingplace@gmail.com¬†for a $50 gift card good for first time orders on purchases of $99 or more.  Offer valid while supplies last.¬† If you are looking for a good protein powder, they make an equally nutri-licious plant based protein powder that is enjoyed by some of the world's best athletes.¬† Check it out:¬†¬†https://loving.thegoodinside.com/shop/product/organic-super-protein/¬† You can get the two as a dynamo duo: https://loving.thegoodinside.com/shop/product/organic-greens-protein/¬† 
It's a win win!

